description:
Aikido is a traditional Japanese martial art with roots in the samurai era. It is definitely an art in every sense of the word. Its dedication to harmony and natural, fluid movements lend the art a genuinely beautiful, flowing aesthetic. On the other side, Aikido is also a very practical system of self defense that does not require much strength in application. If you live in the Pee Dee area, please consider trying a FREE trial Aikido class and see if it is something you feel that you would benefit from. We are currently the only location in the Pee Dee area of South Carolina that is offering Aikido classes.
